defs.value:
pub enum AnalysisError {
    CriticalEdge {
        from: BlockIx,
        to: BlockIx,
    },
    EntryLiveinValues(Vec<Reg>),
    IllegalRealReg(RealReg),
    UnreachableBlocks,
    ImplementationLimitsExceeded,
    LSRACantDoStackmaps,
}

pub enum CheckerError {
    MissingAllocationForReg {
        reg: VirtualReg,
        inst: InstIx,
    },
    UnknownValueInReg {
        real_reg: RealReg,
        inst: InstIx,
    },
    IncorrectValueInReg {
        actual: Reg,
        expected: Reg,
        real_reg: RealReg,
        inst: InstIx,
    },
    UnknownValueInSlot {
        slot: SpillSlot,
        expected: Reg,
        inst: InstIx,
    },
    IncorrectValueInSlot {
        slot: SpillSlot,
        expected: Reg,
        actual: Reg,
        inst: InstIx,
    },
    StackMapSpecifiesNonRefSlot {
        inst: InstIx,
        slot: SpillSlot,
    },
    StackMapSpecifiesUndefinedSlot {
        inst: InstIx,
        slot: SpillSlot,
    },
}
